import React from 'react'
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'
import Home from './modules/Home.js'

export default function App() {
  return (
    <Router>
      <Routes>
        <Route  path='/' element={<Home/>}  />
      </Routes>
    </Router>
  )
}
